a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D1%86%D0%B8%D0%BB%D0%B8%D1%8F\" title=\"\u0421\u0438\u0446\u0438\u043b\u0438\u044f\">\u0421\u0438\u0446\u0438\u043b\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1858_%D0%B3%D0%BE%D0%B4\" title=\"1858 \u0433\u043e\u0434\">1858<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BD%D0%BD%D0%B5%D1%81%D0%BE%D1%82%D0%B0\" title=\"\u041c\u0438\u043d\u043d\u0435\u0441\u043e\u0442\u0430\">\u041c\u0438\u043d\u043d\u0435\u0441\u043e\u0442\u0430<\/a> \u0441\u0442\u0430\u043b\u0430 32-\u043c \u0448\u0442\u0430\u0442\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1867_%D0%B3%D0%BE%D0%B4\" title=\"1867 \u0433\u043e\u0434\">1867<\/a>&#160;\u2014 \u043d\u0430 \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0435 \u0434\u0435\u0440\u0436\u0430\u0432\u044b \u0433\u0430\u0440\u0430\u043d\u0442\u0438\u0440\u043e\u0432\u0430\u043b\u0438 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u0438 \u043d\u0435\u0439\u0442\u0440\u0430\u043b\u0438\u0442\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%BA%D1%81%D0%B5%D0%BC%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u041b\u044e\u043a\u0441\u0435\u043c\u0431\u0443\u0440\u0433\">\u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u0433\u0435\u0440\u0446\u043e\u0433\u0441\u0442\u0432\u0430 \u041b\u044e\u043a\u0441\u0435\u043c\u0431\u0443\u0440\u0433<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1878_%D0%B3%D0%BE%D0%B4\" title=\"1878 \u0433\u043e\u0434\">1878<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A5%D0%B5%D0%B4%D0%B5%D0%BB%D1%8C,_%D0%9C%D0%B0%D0%BA%D1%81&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0425\u0435\u0434\u0435\u043b\u044c, \u041c\u0430\u043a\u0441 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041c\u0430\u043a\u0441 \u0425\u0435\u0434\u0435\u043b\u044c<\/a> \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u043f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u0435 \u043d\u0430 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BB%D1%8C%D0%B3%D0%B5%D0%BB%D1%8C%D0%BC_I_(%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D0%B8)\" title=\"\u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c I (\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438)\">\u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c\u0430 I<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043d\u0435 \u043f\u043e\u0441\u0442\u0440\u0430\u0434\u0430\u043b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1881_%D0%B3%D0%BE%D0%B4\" title=\"1881 \u0433\u043e\u0434\">1881<\/a>&#160;\u2014 \u0432\u044b\u0448\u0435\u043b \u043e\u0442\u043a\u0440\u044b\u0432\u0448\u0438\u0439 \u044d\u043f\u043e\u0445\u0443 \u043a\u043e\u043d\u0442\u0440\u0440\u0435\u0444\u043e\u0440\u043c \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0441\u043a\u0438\u0439 \u043c\u0430\u043d\u0438\u0444\u0435\u0441\u0442, \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u043d\u044b\u0439 \u043f\u043e\u0434 \u0432\u043b\u0438\u044f\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B1%D0%B5%D0%B4%D0%BE%D0%BD%D0%BE%D1%81%D1%86%D0%B5%D0%B2,_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041f\u043e\u0431\u0435\u0434\u043e\u043d\u043e\u0441\u0446\u0435\u0432, \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d \u041f\u0435\u0442\u0440\u043e\u0432\u0438\u0447\">\u041a.&#160;\u041f.&#160;\u041f\u043e\u0431\u0435\u0434\u043e\u043d\u043e\u0441\u0446\u0435\u0432\u0430<\/a>, \u043e\u0431\u0435\u0440-\u043f\u0440\u043e\u043a\u0443\u0440\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D1%8F%D1%82%D0%B5%D0%B9%D1%88%D0%B8%D0%B9_%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D1%83%D1%8E%D1%89%D0%B8%D0%B9_%D1%81%D0%B8%D0%BD%D0%BE%D0%B4\" title=\"\u0421\u0432\u044f\u0442\u0435\u0439\u0448\u0438\u0439 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u0439 \u0441\u0438\u043d\u043e\u0434\">\u0421\u0432\u044f\u0442\u0435\u0439\u0448\u0435\u0433\u043e \u0421\u0438\u043d\u043e\u0434\u0430<\/a>. \u041c\u0430\u043d\u0438\u0444\u0435\u0441\u0442\u043e\u043c \u043d\u043e\u0432\u044b\u0439 \u0446\u0430\u0440\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_III\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 III\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 III<\/a> (\u0441\u044b\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_II\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 II\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 II<\/a>) \u043f\u043e\u0434\u0442\u0432\u0435\u0440\u0434\u0438\u043b \u0441\u0432\u043e\u044e \u043f\u0440\u0438\u0432\u0435\u0440\u0436\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u043e\u0445\u0440\u0430\u043d\u0435 \u0441\u0430\u043c\u043e\u0434\u0435\u0440\u0436\u0430\u0432\u0438\u044f \u0438 \u0435\u0433\u043e \u0443\u0441\u0442\u043e\u0435\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1891_%D0%B3%D0%BE%D0%B4\" title=\"1891 \u0433\u043e\u0434\">1891<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D1%86%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%B2_%D0%9E%D1%86%D1%83\" title=\"\u0418\u043d\u0446\u0438\u0434\u0435\u043d\u0442 \u0432 \u041e\u0446\u0443\">\u0418\u043d\u0446\u0438\u0434\u0435\u043d\u0442 \u0432 \u041e\u0446\u0443<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1896_%D0%B3%D0%BE%D0%B4\" title=\"1896 \u0433\u043e\u0434\">1896<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%BC%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D1%85%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82\" title=\"\u0422\u043e\u043c\u0441\u043a\u0438\u0439 \u043f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\">\u0422\u043e\u043c\u0441\u043a\u0438\u0439 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442<\/a> (\u043d\u044b\u043d\u0435 \u0422\u043e\u043c\u0441\u043a\u0438\u0439 \u043f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442).<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911_%D0%B3%D0%BE%D0%B4\" title=\"1911 \u0433\u043e\u0434\">1911<\/a>&#160;\u2014 \u0418.&#160;\u0418.&#160;\u0421\u0442\u0430\u0445\u043e\u0432\u0441\u043a\u0438\u0439 \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u043f\u043e\u043b\u0451\u0442 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D0%B4%D1%80%D0%BE%D1%81%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0413\u0438\u0434\u0440\u043e\u0441\u0430\u043c\u043e\u043b\u0451\u0442\">\u0433\u0438\u0434\u0440\u043e\u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0435<\/a> \u00ab\u0412\u0443\u0430\u0437\u0435\u043d-\u041a\u0430\u043d\u0430\u0440\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1912_%D0%B3%D0%BE%D0%B4\" title=\"1912 \u0433\u043e\u0434\">1912<\/a>&#160;\u2014 \u0432 \u0447\u0435\u0441\u0442\u044c 200-\u043b\u0435\u0442\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D1%80%D1%83%D0%B6%D0%B5%D0%B9%D0%BD%D1%8B%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4\" title=\"\u0422\u0443\u043b\u044c\u0441\u043a\u0438\u0439 \u043e\u0440\u0443\u0436\u0435\u0439\u043d\u044b\u0439 \u0437\u0430\u0432\u043e\u0434\">\u0422\u0443\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u043e\u0440\u0443\u0436\u0435\u0439\u043d\u043e\u0433\u043e \u0437\u0430\u0432\u043e\u0434\u0430<\/a> \u043e\u0442\u043a\u0440\u044b\u0442 \u043f\u0430\u043c\u044f\u0442\u043d\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I\" title=\"\u041f\u0451\u0442\u0440 I\">\u041f\u0435\u0442\u0440\u0443 I<\/a>, \u043e\u0442\u0446\u0443-\u043f\u043e\u043a\u0440\u043e\u0432\u0438\u0442\u0435\u043b\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D0%BB%D0%B0\" title=\"\u0422\u0443\u043b\u0430\">\u0442\u0443\u043b\u044c\u0441\u043a\u0438\u0445<\/a> \u043c\u0430\u0441\u0442\u0435\u0440\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u0441 \u043f\u043e\u0434\u0430\u0447\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B7%D0%B5%D1%80%D0%B6%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9,_%D0%A4%D0%B5%D0%BB%D0%B8%D0%BA%D1%81_%D0%AD%D0%B4%D0%BC%D1%83%D0%BD%D0%B4%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0414\u0437\u0435\u0440\u0436\u0438\u043d\u0441\u043a\u0438\u0439, \u0424\u0435\u043b\u0438\u043a\u0441 \u042d\u0434\u043c\u0443\u043d\u0434\u043e\u0432\u0438\u0447\">\u0424\u0435\u043b\u0438\u043a\u0441\u0430 \u0414\u0437\u0435\u0440\u0436\u0438\u043d\u0441\u043a\u043e\u0433\u043e<\/a> \u043f\u0440\u0435\u0437\u0438\u0434\u0438\u0443\u043c \u0412\u0426\u0418\u041a \u0432\u044b\u043d\u0435\u0441 \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u043e \u0437\u0430\u043a\u0440\u044b\u0442\u0438\u0438 \u043c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0445 \u0433\u0430\u0437\u0435\u0442, \u043f\u043e\u043c\u0435\u0449\u0430\u044e\u0449\u0438\u0445 \u00ab\u043b\u043e\u0436\u043d\u044b\u0435 \u0441\u043b\u0443\u0445\u0438\u2026 \u0438\u0441\u043a\u043b\u044e\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u043a \u0442\u043e\u043c\u0443, \u0447\u0442\u043e\u0431\u044b \u043f\u043e\u0441\u0435\u044f\u0442\u044c \u0441\u0440\u0435\u0434\u0438 \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u044f \u043f\u0430\u043d\u0438\u043a\u0443 \u0438 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c \u0433\u0440\u0430\u0436\u0434\u0430\u043d \u043f\u0440\u043e\u0442\u0438\u0432 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0432\u043b\u0430\u0441\u0442\u0438\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a><ul><li>\u0421\u043e\u0432\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BA%D1%81%D1%84%D0%BE%D1%80%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82\" title=\"\u041e\u043a\u0441\u0444\u043e\u0440\u0434\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\">\u041e\u043a\u0441\u0444\u043e\u0440\u0434\u0441\u043a\u043e\u0433\u043e \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430<\/a> \u043f\u043e\u0437\u0432\u043e\u043b\u0438\u043b \u0436\u0435\u043d\u0449\u0438\u043d\u0430\u043c \u043f\u043e\u043b\u0443\u0447\u0430\u0442\u044c \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u0435 \u0432 \u0441\u0432\u043e\u0438\u0445 \u0441\u0442\u0435\u043d\u0430\u0445.<\/li><li>\u0412\u044b\u0448\u0435\u043b \u0432 \u0441\u0432\u0435\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u043d\u043e\u043c\u0435\u0440 \u0433\u0430\u0437\u0435\u0442\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D0%B4%D0%BE%D0%BA_(%D0%B3%D0%B0%D0%B7%D0%B5%D1%82%D0%B0)\" title=\"\u0413\u0443\u0434\u043e\u043a (\u0433\u0430\u0437\u0435\u0442\u0430)\">\u0413\u0443\u0434\u043e\u043a<\/a>\u00bb.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1926_%D0%B3%D0%BE%D0%B4\" title=\"1926 \u0433\u043e\u0434\">1926<\/a>&#160;\u2014 \u0441\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BF%D0%B8%D1%86%D0%B1%D0%B5%D1%80%D0%B3%D0%B5%D0%BD\" title=\"\u0428\u043f\u0438\u0446\u0431\u0435\u0440\u0433\u0435\u043d\">\u0428\u043f\u0438\u0446\u0431\u0435\u0440\u0433\u0435\u043d\u0430<\/a> \u0432 \u0422\u0435\u043b\u043b\u0435\u0440 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8F%D1%81%D0%BA%D0%B0\" title=\"\u0410\u043b\u044f\u0441\u043a\u0430\">\u0410\u043b\u044f\u0441\u043a\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a>) \u0432 \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043d\u0430 \u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u0435 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D1%8B%D0%B9_%D0%BF%D0%BE%D0%BB%D1%8E%D1%81\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u043f\u043e\u043b\u044e\u0441\">\u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u043f\u043e\u043b\u044e\u0441<\/a> \u0432\u044b\u043b\u0435\u0442\u0435\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%80%D0%B8%D0%B6%D0%B0%D0%B1%D0%BB%D1%8C\" title=\"\u0414\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c\">\u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c<\/a> \u00ab\u041d\u043e\u0440\u0432\u0435\u0433\u0438\u044f\u00bb. \u0421\u0440\u0435\u0434\u0438 \u0447\u043b\u0435\u043d\u043e\u0432 \u044d\u043a\u0438\u043f\u0430\u0436\u0430&#160;\u2014 \u0432\u044b\u0434\u0430\u044e\u0449\u0438\u0435\u0441\u044f \u043b\u0438\u0447\u043d\u043e\u0441\u0442\u0438: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D1%83%D0%BD%D0%B4%D1%81%D0%B5%D0%BD,_%D0%A0%D1%83%D0%B0%D0%BB%D1%8C\" title=\"\u0410\u043c\u0443\u043d\u0434\u0441\u0435\u043d, \u0420\u0443\u0430\u043b\u044c\">\u0410\u043c\u0443\u043d\u0434\u0441\u0435\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B1%D0%B8%D0%BB%D0%B5,_%D0%A3%D0%BC%D0%B1%D0%B5%D1%80%D1%82%D0%BE\" title=\"\u041d\u043e\u0431\u0438\u043b\u0435, \u0423\u043c\u0431\u0435\u0440\u0442\u043e\">\u0423\u043c\u0431\u0435\u0440\u0442\u043e \u041d\u043e\u0431\u0438\u043b\u0435<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%AD%D0%BB%D0%BB%D1%81%D1%83%D0%BE%D1%80%D0%B4,_%D0%9B%D0%B8%D0%BD%D0%BA%D0%BE%D0%BB%D1%8C%D0%BD&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u042d\u043b\u043b\u0441\u0443\u043e\u0440\u0434, \u041b\u0438\u043d\u043a\u043e\u043b\u044c\u043d (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041b\u0438\u043d\u043a\u043e\u043b\u044c\u043d \u042d\u043b\u043b