\u043d\u0446\u0438\u044f<\/a>) \u043f\u0440\u0438\u043d\u044f\u0442\u043e \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043e\u0431 \u0443\u0441\u0438\u043b\u0435\u043d\u0438\u0438 \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e, \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0438 \u0432\u043e\u0435\u043d\u043d\u043e\u0433\u043e \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0430 \u0438 \u043e\u0431 \u0443\u0447\u0430\u0441\u0442\u0438\u0438 \u0432 \u043d\u0451\u043c \u0417\u0430\u043f\u0430\u0434\u043d\u043e\u0439 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u0432 \u0442\u0435\u0430\u0442\u0440\u0435 Th\u00e9\u00e2tre des Noctambules (\u0422\u0435\u0430\u0442\u0440\u0435 \u043f\u043e\u043b\u0443\u043d\u043e\u0447\u043d\u0438\u043a\u043e\u0432) \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u043f\u044c\u0435\u0441\u044b \u0444\u0440\u0430\u043d\u043a\u043e-\u0440\u0443\u043c\u044b\u043d\u0441\u043a\u043e\u0433\u043e \u0434\u0440\u0430\u043c\u0430\u0442\u0443\u0440\u0433\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BE%D0%BD%D0%B5%D1%81%D0%BA%D0%BE,_%D0%AD%D0%B6%D0%B5%D0%BD\" title=\"\u0418\u043e\u043d\u0435\u0441\u043a\u043e, \u042d\u0436\u0435\u043d\">\u042d\u0436\u0435\u043d\u0430 \u0418\u043e\u043d\u0435\u0441\u043a\u043e<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8B%D1%81%D0%B0%D1%8F_%D0%BF%D0%B5%D0%B2%D0%B8%D1%86%D0%B0\" title=\"\u041b\u044b\u0441\u0430\u044f \u043f\u0435\u0432\u0438\u0446\u0430\">\u041b\u044b\u0441\u0430\u044f \u043f\u0435\u0432\u0438\u0446\u0430<\/a>\u00bb<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1955_%D0%B3%D0%BE%D0%B4\" title=\"1955 \u0433\u043e\u0434\">1955<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0441\u043e\u0432\u0435\u0449\u0430\u043d\u0438\u0435 \u0432 \u0412\u0430\u0440\u0448\u0430\u0432\u0435 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0435\u0439 \u0432\u043e\u0441\u044c\u043c\u0438 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0445 \u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0441\u0442\u0440\u0430\u043d \u043f\u043e \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0435\u043d\u0438\u044e \u043c\u0438\u0440\u0430 \u0438 \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438 \u0432 \u0415\u0432\u0440\u043e\u043f\u0435, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0437\u0430\u043a\u043b\u044e\u0447\u0438\u043b\u0438 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u0434\u0440\u0443\u0436\u0431\u0435, \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0435 \u0438 \u0432\u0437\u0430\u0438\u043c\u043d\u043e\u0439 \u043f\u043e\u043c\u043e\u0449\u0438 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" class=\"mw-redirect\" title=\"\u0412\u0430\u0440\u0448\u0430\u0432\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\">\u0412\u0430\u0440\u0448\u0430\u0432\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1959_%D0%B3%D0%BE%D0%B4\" title=\"1959 \u0433\u043e\u0434\">1959<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B5%D0%BD%D0%B5%D0%B2%D0%B0\" title=\"\u0416\u0435\u043d\u0435\u0432\u0430\">\u0416\u0435\u043d\u0435\u0432\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0430\u0441\u044c \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u04